"87492":{"id":"87492","name":"Foxcatcher: Uma História Que Chocou o Mundo","slug":"foxcatcher-uma-historia-que-chocou-o-mundo","original_title":"Foxcatcher","overview":"O milionário John du Pont convida o campeão olímpico de luta greco-romana, Mark Schultz, para mudar-se para sua mansão e ajudar a formar uma equipe para as Olimpíadas de 1988. O lutador vê a oportunidade como uma maneira de sair da sombra de seu irmão mais velho, uma lenda no esporte. Também atraído pelo salário e condições de vida oferecidas, ele aceita a proposta. Mark e John se tornam amigos, mas a difícil personalidade do milionário faz com que Mark acabe indo em direção a uma tragédia.","first_air_date":"2014-11-14","runtime":134,"episode_run_time":[134],"vote_average":6.7,"created_by":["Annapurna Pictures","Likely Story"],"production_companies":[{"name":"Annapurna Pictures"},{"name":"Likely Story"}],"cast":["Steve Carell","Channing Tatum","Mark Ruffalo","Sienna Miller","Vanessa Redgrave"],"backdrop_path":"https://image.tmdb.org/t/p/original/tT8vexYdyHG0nHyXQkhzt8tbFkt.jpg","poster_path":"https://image.tmdb.org/t/p/original/bim6tB3N5xB7wXjanWPIV14Qq53.jpg","certification":"14","genres":["Drama","Thriller"],"trailer":"JVJ5fIKhUWE"},
"255798":{"id":"255798","name":"Enterrando Minha Ex","slug":"enterrando-minha-ex","original_title":"Burying the Ex","overview":"Max e Evelyn juram amor eterno. Mas, quando resolvem morar juntos, a convivência se torna muito difícil. Evelyn é atropelada por um ônibus no momento em que Max decide terminar o namoro. O que ele não esperava é que sua ex-namorada voltasse à vida como zumbi.","first_air_date":"2014-09-04","runtime":89,"episode_run_time":[89],"vote_average":5.5,"created_by":["ArtImage Entertainment","Scooty Woop Entertainment","Voltage Pictures"],"production_companies":[{"name":"ArtImage Entertainment"},{"name":"Scooty Woop Entertainment"},{"name":"Voltage Pictures"}],"cast":["Anton Yelchin","Ashley Greene","Alexandra Daddario","Oliver Cooper","Dick Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/v018UdfS3WDGGfUyWlk4byUWzon.jpg","poster_path":"https://image.tmdb.org/t/p/original/CcHHeRwGW84ahSXhEbqJrCbkKk.jpg","certification":"N/A","genres":["Comédia","Terror"],"trailer":"N/A"},
"617762":{"id":"617762","name":"A Vida Eletrizante de Louis Wain","slug":"a-vida-eletrizante-de-louis-wain","original_title":"The Electrical Life of Louis Wain","overview":"Cinebiografia do artista inglês Louis Wain, que viveu entre 1860-1939 e é mais conhecido por seus desenhos, que consistentemente apresentavam gatos e gatinhos antropomorfizados de olhos grandes. Em seus últimos anos, ele pode ter sofrido de esquizofrenia (embora alguns especialistas contestem essa afirmação), o que, segundo alguns psiquiatras, pode ser visto em suas obras.","first_air_date":"2021-10-21","runtime":111,"episode_run_time":[111],"vote_average":6.9,"created_by":["StudioCanal","Shoebox Films","Film4 Productions","SunnyMarch"],"production_companies":[{"name":"StudioCanal"},{"name":"Shoebox Films"},{"name":"Film4 Productions"},{"name":"SunnyMarch"}],"cast":["Benedict Cumberbatch","Claire Foy","Andrea Riseborough","Toby Jones","Sharon Rooney"],"backdrop_path":"https://image.tmdb.org/t/p/original/vwtvQochfV2XZgQsxLueUSvdmPd.jpg","poster_path":"https://image.tmdb.org/t/p/original/zWtI3BI6dnfwRIr7xk2xC84Zian.jpg","certification":"14","genres":["Drama","História","Comédia","Romance"],"trailer":"N/A"},
