"14181":{"id":"14181","name":"O Primeiro Milhão","slug":"o-primeiro-milhao","original_title":"Boiler Room","overview":"Seth Davis (Giovanni Ribisi) um jovem trambiqueiro que montou um pequeno cassino em seu apartamento e possui dois sonhos na vida: ganhar seu primeiro milhão de dólares e conquistar o respeito do pai, um importante juiz federal. Para isso, ele tenta deixar de lado sua vida ilegal e sai em busca de um emprego de verdade. Consegue uma vaga numa empresa que promete transformar seus empregados em milionários. Mas a felicidade dura pouco, pois logo Seth descobre que existe algo de na empresa.","first_air_date":"2000-02-18","runtime":118,"episode_run_time":[118],"vote_average":6.7,"created_by":["New Line Cinema"],"production_companies":[{"name":"New Line Cinema"}],"cast":["Giovanni Ribisi","Vin Diesel","Nia Long","Nicky Katt","Scott Caan"],"backdrop_path":"https://image.tmdb.org/t/p/original/A96CVXbTNfhqw3jkUlyfFnGe8i3.jpg","poster_path":"https://image.tmdb.org/t/p/original/i8FcOABRZNCjUlAcV6QksEoubP3.jpg","certification":"N/A","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
