"801":{"id":"801","name":"Bom Dia, Vietnã","slug":"bom-dia-vietna","original_title":"Good Morning, Vietnam","overview":"Convocado pelo exército para transmitir um programa de rádio, Cronauer acaba com a caretice das ondas pasteurizadas da rádio, com suas piadas e os últimos sucessos musicais da América. Os soldados o veneram enquanto as altas patentes o consideram um ultraje.","first_air_date":"1987-12-23","runtime":121,"episode_run_time":[121],"vote_average":7.3,"created_by":["Touchstone Pictures","Silver Screen Partners III"],"production_companies":[{"name":"Touchstone Pictures"},{"name":"Silver Screen Partners III"}],"cast":["Robin Williams","Forest Whitaker","Tom T. Tran","จินตหรา สุขพัฒน์","Bruno Kirby"],"backdrop_path":"https://image.tmdb.org/t/p/original/l04cyHUP6PCAozc2GMEHPguu7AN.jpg","poster_path":"https://image.tmdb.org/t/p/original/nCGK7GwtjCu2gvdfyvxLX3JkxE9.jpg","certification":"L","genres":["Comédia","Drama","Guerra"],"trailer":"N/A"},
"10934":{"id":"10934","name":"Sob o Sol da Toscana","slug":"sob-o-sol-da-toscana","original_title":"Under the Tuscan Sun","overview":"Frances Mayes (Diane Lane) é uma escritora que leva uma vida feliz em San Francisco, até que se divorcia. Triste e deprimida viaja para a Itália e então... ela decide mudar radicalmente de vida e compra uma chácara na Toscana, para descansar e poder terminar em paz seu novo texto. Porém enquanto ela cuida da reforma de sua nova casa acaba conhecendo as pessoas da região, os operários, os moradores da vila e claro... um homem, que reacende sua paixão.","first_air_date":"2003-09-20","runtime":114,"episode_run_time":[114],"vote_average":6.9,"created_by":["Touchstone Pictures","Timnick Films","Blue Gardenia Productions"],"production_companies":[{"name":"Touchstone Pictures"},{"name":"Timnick Films"},{"name":"Blue Gardenia Productions"}],"cast":["Diane Lane","Sandra Oh","Vincent Riotta","Lindsay Duncan","Raoul Bova"],"backdrop_path":"https://image.tmdb.org/t/p/original/dy516GsG7lvszB47FiotNjLARDY.jpg","poster_path":"https://image.tmdb.org/t/p/original/nvI0t29g8ZKWOr9NSt9UeFFhNbM.jpg","certification":"N/A","genres":["Romance","Comédia"],"trailer":"N/A"},
"4543":{"id":"4543","name":"Monty Python - O Sentido da Vida","slug":"monty-python-o-sentido-da-vida","original_title":"Monty Python's The Meaning of Life","overview":"O humor corrosivo que caracteriza os filmes do grupo Monty Python está afiadíssimo nas histórias de O Sentido da Vida. Nesse filme, a trupe de comediantes britânicos ganha a tela para satirizar a medicina, a igreja, os militares, o sexo, e tudo o que é levado a sério demais pelos seres humanos normais. A ousadia lhes valeu o Prêmio Especial do Júri no Festival de Cannes. O Sentido da Vida mostra porque eles fazem sucesso há três décadas na TV e no cinema de todo o mundo. O Monty Python começou na BBC de Londres em 1969 e logo se espalhou pelo mundo com suas apresentações ao vivo, livros e filmes imperdíveis. Este foi o último filme da trupe que se separou após este trabalho. Em seus filmes, já satirizaram desde Rei Arthur, símbolo máximo da nobreza, justiça e coragem britânicas (Monty Phyton e o Santo Graal, 1975) à Jesus (A Vida de Brian, 1979), personagem que dispensa apresentações.","first_air_date":"1983-03-31","runtime":107,"episode_run_time":[107],"vote_average":7.3,"created_by":["Celandine Films","The Monty Python Partnership","Universal Pictures"],"production_companies":[{"name":"Celandine Films"},{"name":"The Monty Python Partnership"},{"name":"Universal Pictures"}],"cast":["Terry Gilliam","Graham Chapman","John Cleese","Eric Idle","Terry Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/eIcJq4QDmToJeu4g6fS4iLPKY8n.jpg","poster_path":"https://image.tmdb.org/t/p/original/2IeFa1GvR7KaQuFo3Iqeh1ThHew.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"9490":{"id":"9490","name":"Pra lá de Bagdá","slug":"pra-la-de-bagda","original_title":"Half Baked","overview":"Amigos de infância, três caras loucos envolvem-se em grandes confusões quando tentam arrumar um jeito para livrar um companheiro da prisão. Sem muitos recursos, eles vão fazer de tudo, o que inclui a venda de maconha e por consequência, o envolvimento numa briga com um traficante da cidade que não gosta de concorrência.","first_air_date":"1998-01-16","runtime":82,"episode_run_time":[82],"vote_average":6.3,"created_by":["Universal Pictures","Robert Simonds Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Robert Simonds Productions"}],"cast":["Dave Chappelle","Jim Breuer","Harland Williams","Guillermo Díaz","Rachel True"],"backdrop_path":"https://image.tmdb.org/t/p/original/yl7M1buWaxXXhZv0bSbi4MPYVKm.jpg","poster_path":"https://image.tmdb.org/t/p/original/apln3uNxOrvee34adSIenaSzEk4.jpg","certification":"N/A","genres":["Comédia","Crime"],"trailer":"N/A"},
"10868":{"id":"10868","name":"Acusados","slug":"acusados","original_title":"The Accused","overview":"Sarah Tobias é estuprada em um bar e, ao denunciar a agressão, defronta-se com dois problemas: seus agressores e o sistema penal, no qual as vítimas de estupro são suspeitas em seus próprios casos.","first_air_date":"1988-10-14","runtime":111,"episode_run_time":[111],"vote_average":7.0,"created_by":["Paramount Pictures Canada","Paramount Pictures","Jaffe-Lansing"],"production_companies":[{"name":"Paramount Pictures Canada"},{"name":"Paramount Pictures"},{"name":"Jaffe-Lansing"}],"cast":["Jodie Foster","Kelly McGillis","Bernie Coulson","Leo Rossi","Ann Hearn"],"backdrop_path":"https://image.tmdb.org/t/p/original/qxZz6UlcMZJlYTy3RKhYwoSpbvh.jpg","poster_path":"https://image.tmdb.org/t/p/original/kEpHGhM2fyzY20Ff9lhfm4Poif9.jpg","certification":"N/A","genres":["Crime","Drama"],"trailer":"N/A"},
"2007":{"id":"2007","name":"O Óleo de Lorenzo","slug":"o-oleo-de-lorenzo","original_title":"Lorenzo's Oil","overview":"Um garoto levava uma vida normal até que, quando tinha seis anos, estranhas coisas aconteceram, pois ele passou a ter diversos problemas de ordem mental que foram diagnosticados como ALD, uma doença extremamente rara que provoca uma incurável degeneração no cérebro, levando o paciente à morte em no máximo dois anos. Os pais do menino ficam frustrados com o fracasso dos médicos e a falta de medicamento para uma doença desta natureza. Assim, começam a estudar e a pesquisar sozinhos, na esperança de descobrir algo que possa deter o avanço da doença.","first_air_date":"1992-12-30","runtime":135,"episode_run_time":[135],"vote_average":7.1,"created_by":["Universal Pictures","Kennedy Miller Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Kennedy Miller Productions"}],"cast":["Nick Nolte","Susan Sarandon","Peter Ustinov","Ann Hearn","Maduka Steady"],"backdrop_path":"https://image.tmdb.org/t/p/original/gYapxyWZXFYcCHtf5dVB2Ub9RTy.jpg","poster_path":"https://image.tmdb.org/t/p/original/kTDqzoyGj1io11KUZVpnhT8upJa.jpg","certification":"L","genres":["Drama"],"trailer":"N/A"},
