"628534":{"id":"628534","name":"O Tigre Branco","slug":"o-tigre-branco","original_title":"The White Tiger","overview":"Balram Halwai (Adarsh ​​Gourav) narra sua ascensão épica e sombriamente humorística de pobre aldeão a empresário de sucesso na Índia moderna. Astuto e ambicioso, nosso jovem herói abre caminho para se tornar o motorista de Ashok (Rajkumar Rao) e Pinky (Priyanka Chopra-Jonas), que acabam de retornar da América. A sociedade treinou Balram para ser uma coisa – um servo – então ele se torna indispensável para seus mestres ricos. Mas depois de uma noite de traição, ele percebe o quão corruptos eles serão para prendê-lo. À beira de perder tudo, Balram se rebela contra um sistema fraudulento e desigual para se levantar e se tornar um novo tipo de mestre.","first_air_date":"2021-01-13","runtime":125,"episode_run_time":[125],"vote_average":7.0,"created_by":["Lava Media","Noruz Films","ARRAY Filmworks"],"production_companies":[{"name":"Lava Media"},{"name":"Noruz Films"},{"name":"ARRAY Filmworks"}],"cast":["Adarsh Gourav","Rajkummar Rao","प्रियंका चोपड़ा जोनस","Mahesh Manjrekar","Vijay Maurya"],"backdrop_path":"https://image.tmdb.org/t/p/original/wz4BoW7k5LNluY4PmxHBU1IS5Bc.jpg","poster_path":"https://image.tmdb.org/t/p/original/FHpjm49uWcwqE3qITgysvBb6sw.jpg","certification":"N/A","genres":["Drama"],"trailer":"igsPME8oEO0"},
