"3980":{"id":"3980","name":"Criaturas","slug":"criaturas","original_title":"Critters","overview":"Do outro lado do espaço sideral, um pequeno grupo de terríveis criaturas com uma fome voraz escapa facilmente de um asteróide de segurança máxima e parte rumo à liberdade. Eles são seguidos de perto por caçadores de recompensa intergalácticos, que terão muito trabalho para impedi-los de chegar ao seu objetivo final: a Terra. Já no nosso planeta, as criaturas acabam caindo em uma pequena cidade do interior dos EUA, onde começam a devorar tudo (e todos) que vêem pela frente. Ou a vizinhança liderada por Helen Brown tenta combater esta ameaça por conta própria, ou serão todos vítimas destes seres famintos. A batalha começou em outra galáxia… e vai acabar bem no jardim da família Brown.","first_air_date":"1986-04-11","runtime":82,"episode_run_time":[82],"vote_average":6.5,"created_by":["New Line Cinema","Smart Egg Pictures","Sho Films"],"production_companies":[{"name":"New Line Cinema"},{"name":"Smart Egg Pictures"},{"name":"Sho Films"}],"cast":["Dee Wallace","M. Emmet Walsh","Billy Green Bush","Scott Grimes","Nadine Van der Velde"],"backdrop_path":"https://image.tmdb.org/t/p/original/omoQkyiQ94FfyR4gUmA66VXQyZ9.jpg","poster_path":"https://image.tmdb.org/t/p/original/yRsQqmUVYcEEMLOxp9vsR13VJXb.jpg","certification":"14","genres":["Comédia","Terror","Ficção científica"],"trailer":"N/A"},
