"529983":{"id":"529983","name":"A Rosa Venenosa","slug":"a-rosa-venenosa","original_title":"The Poison Rose","overview":"Carson Phillips, um ex-astro do futebol que virou detetive particular, assume um caso de desaparecimento que lentamente se revela uma complexa teia de crimes, suspeitos e cadáveres. Quando ele descobre que sua filha é a suspeita número um, ele corre contra o relógio para salvá-la, resolver os assassinatos e descobrir os segredos sujos da cidade.","first_air_date":"2019-05-23","runtime":97,"episode_run_time":[97],"vote_average":4.7,"created_by":["March On Productions","JTP Films","Millennium Media"],"production_companies":[{"name":"March On Productions"},{"name":"JTP Films"},{"name":"Millennium Media"}],"cast":["John Travolta","Morgan Freeman","Peter Stormare","Famke Janssen","Robert Patrick"],"backdrop_path":"https://image.tmdb.org/t/p/original/cXpkDrZWK8amdYXzf24LH67Vftn.jpg","poster_path":"https://image.tmdb.org/t/p/original/g0yhg61JGBjoWlqj9Lus3XiQA3i.jpg","certification":"12","genres":["Thriller","Crime"],"trailer":"N/A"},
"4435":{"id":"4435","name":"Asoka","slug":"asoka","original_title":"अशोक","overview":"erceiro imperador da dinastia Mauryan, Asoka fez de Magadha, por volta do ano 3 a.C., o reino mais próspero e poderoso da Índia. Asoka é mais conhecido por ter espalhado os conhecimentos do budismo pela Ásia. Mostram-se fatos importantes de sua vida, como suas aspirações ao trono, a rotina de viajante e a trajetória como conquistador. Representante da tradicional produção de Bollywood, o cineasta, coroteirista e diretor de fotografia Santosh Sivan realiza um épico com mais de duas horas de duração e os caros números musicais sempre presentes no cinema indiano. O filme mistura romance, drama, busca espiritual e cenas de batalha. Como de fato se sabe muito pouco sobre a vida de Asoka, Sivan soltou a imaginação e criou uma intensa história de amor, tendo eventos políticos e intrigas familiares como pano de fundo.","first_air_date":"2001-09-13","runtime":176,"episode_run_time":[176],"vote_average":6.5,"created_by":["Red Chillies Entertainment"],"production_companies":[{"name":"Red Chillies Entertainment"}],"cast":["शाहरुख़ ख़ान","Kareena Kapoor Khan","Hrishitaa Bhatt","Danny Denzongpa","Sooraj Balaji"],"backdrop_path":"https://image.tmdb.org/t/p/original/jyGiG4wcr0BHpqIXiep5MRCQ7Kz.jpg","poster_path":"https://image.tmdb.org/t/p/original/ckFDMqLjhsYo2kH3X5auV1NnjPM.jpg","certification":"N/A","genres":["Ação","Aventura","Drama","História","Romance","Guerra"],"trailer":"N/A"},
"55420":{"id":"55420","name":"A Outra Terra","slug":"a-outra-terra","original_title":"Another Earth","overview":"Rhoda Williams, uma mulher jovem e brilhante recentemente aceita no programa de astrofísica do MIT, pretende explorar o cosmos. John Burroughs, um compositor brilhante, acaba de atingir o auge de sua profissão, e está prestes a ter um segundo filho com sua esposa amorosa. Na véspera da descoberta de um novo planeta no espaço, aparentemente escondido atrás do sol (um segundo planeta Terra), a tragédia, e as vidas desses estranhos tornam-se irremediavelmente entrelaçadas. Distante do mundo e os seres que eles conheciam, os dois jovens começam um caso de amor improvável, que vai despertá-los para a vida. Mas quando um deles é apresentado com a oportunidade de viajar para a Terra, outros abraçam uma realidade alternativa. Que vida nova eles vão escolher?","first_air_date":"2011-07-22","runtime":92,"episode_run_time":[92],"vote_average":6.7,"created_by":["Artists Public Domain","Fox Searchlight Pictures"],"production_companies":[{"name":"Artists Public Domain"},{"name":"Fox Searchlight Pictures"}],"cast":["Brit Marling","William Mapother","Matthew-Lee Erlbach","Meggan Lennon","AJ Diana"],"backdrop_path":"https://image.tmdb.org/t/p/original/fJfpZnS2pvFCtyaDqoIgKLASvAT.jpg","poster_path":"https://image.tmdb.org/t/p/original/93p5eYeAYc2sFXCaLSV5eapk9z1.jpg","certification":"N/A","genres":["Drama","Ficção científica"],"trailer":"N/A"},
