"6723":{"id":"6723","name":"Rookie: Um Profissional do Perigo","slug":"rookie-um-profissional-do-perigo","original_title":"The Rookie","overview":"Nick Pulovski (Clint Eastwood) é um policial que está na divisão de roubo de carros e nunca conseguiu realizar um grande feito em sua vida. Quando ele descobre que um homem chamado Strom é o chefe por trás de um grande roubo, ele vê sua grande chance. Mas seu parceiro é assassinado durante missão, o caso é transferido para o departamento de homicídios e ele não tem mais acesso aos arquivos. Pulovski ganha um novo parceiro, David Ackerman (Charlie Sheen), e quer continuar em busca de Strom, mesmo não estando mais oficialmente ligado ao caso.","first_air_date":"1990-12-07","runtime":120,"episode_run_time":[120],"vote_average":5.9,"created_by":["Malpaso Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Malpaso Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Clint Eastwood","Charlie Sheen","Raúl Juliá","Sônia Braga","Tom Skerritt"],"backdrop_path":"https://image.tmdb.org/t/p/original/9Njx2J5p4f4OaH6vZZHUCxw73uK.jpg","poster_path":"https://image.tmdb.org/t/p/original/abnGPeBcYxoV1HVBETFaf9Kq0vr.jpg","certification":"N/A","genres":["Ação","Crime","Drama","Thriller"],"trailer":"N/A"},
