"716612":{"id":"716612","name":"Spencer","slug":"spencer","original_title":"Spencer","overview":"Nos anos 1990, a Princesa Diana passa o feriado do Natal com a família real na propriedade de Sandringham, em Norfolk, Reino Unido. Apesar das bebidas, brincadeiras e comidas que Diana já sabe o script, esse final de ano vai ser diferente. Após rumores de traição e de divórcio, a princesa se vê em um impasse quando percebe que seu casamento com Príncipe Charles já não está mais dando certo, mesmo com os dois filhos. Portanto, ela decide deixá-lo. Este filme é apenas uma especulação do que pode ter acontecido durante aqueles turbulentos dias...","first_air_date":"2021-11-04","runtime":117,"episode_run_time":[117],"vote_average":6.8,"created_by":["FilmNation Entertainment","Komplizen Film","Shoebox Films","Fabula","Fabula"],"production_companies":[{"name":"FilmNation Entertainment"},{"name":"Komplizen Film"},{"name":"Shoebox Films"},{"name":"Fabula"},{"name":"Fabula"}],"cast":["Kristen Stewart","Timothy Spall","Jack Nielen","Freddie Spry","Jack Farthing"],"backdrop_path":"https://image.tmdb.org/t/p/original/uAf1Ua3UDm8cDR2CgNGbZepOqDV.jpg","poster_path":"https://image.tmdb.org/t/p/original/j0XxLH1QcOrnyxBLvMYWJZSzLfH.jpg","certification":"12","genres":["Drama","História"],"trailer":"Turs-wsFPEY"},
"430231":{"id":"430231","name":"O Culto","slug":"o-culto","original_title":"The Endless","overview":"Dois irmãos foram criados num culto religioso do qual fugiram quando Justin percebeu a possibilidade da ocorrência de um suicídio em massa. Dez anos depois, eles, recebem uma mensagem em vídeo bastante enigmática. Nela, um membro do culto fala de uma ‘ascensão’ iminente e então resolvem regressar ao local aonde eram realizados os cultos em busca de respostas. Mas, ao chegarem, descobrem que o ‘culto’ pode afinal não ser o que pensavam e começam a duvidar, inclusive, se serão bem-vindos.","first_air_date":"2017-11-05","runtime":112,"episode_run_time":[112],"vote_average":6.3,"created_by":["Snowfort Pictures","Pfaff & Pfaff Productions","Love & Death Productions","Rustic Films","XYZ Films"],"production_companies":[{"name":"Snowfort Pictures"},{"name":"Pfaff & Pfaff Productions"},{"name":"Love & Death Productions"},{"name":"Rustic Films"},{"name":"XYZ Films"}],"cast":["Aaron Moorhead","Justin Benson","Callie Hernandez","Tate Ellington","Shane Brady"],"backdrop_path":"https://image.tmdb.org/t/p/original/nvCMi8ZhH1Z8i9ZFHYrXBl8uBw0.jpg","poster_path":"https://image.tmdb.org/t/p/original/2D0lOSwNAq1jUmeJgrdgPbBY9dK.jpg","certification":"16","genres":["Ficção científica","Terror","Thriller"],"trailer":"AcUHIUBXJmQ"},
