"12276":{"id":"12276","name":"O Caminho para Casa","slug":"o-caminho-para-casa","original_title":"我的父亲母亲","overview":"A morte do pai leva o executivo Luo Yusheng, de volta para a vila de Sanhetun, onde nascera. O prefeito espera que Luo, convença sua mãe a permitir que o caixão siga num carro em vez de ser carregado durante todo o enterro, como reza a tradição local. Ela, no entanto, prefere seguir os antigos rituais. Enquanto isso, Luo, reflete sobre a paixão entre seus pais, e como o relacionamento deles foi encoberto pelos fatos históricos.","first_air_date":"1999-10-16","runtime":89,"episode_run_time":[89],"vote_average":7.5,"created_by":["Guangxi Film Studio","Beijing New Picture Film Co. Ltd.","Columbia Pictures","Sony Pictures Classics","CP Film Production Asia"],"production_companies":[{"name":"Guangxi Film Studio"},{"name":"Beijing New Picture Film Co. Ltd."},{"name":"Columbia Pictures"},{"name":"Sony Pictures Classics"},{"name":"CP Film Production Asia"}],"cast":["Ziyi Zhang","Zheng Hao","Yulian Zhao","Sun Honglei","李滨"],"backdrop_path":"https://image.tmdb.org/t/p/original/nxzh2GFY0Wb36FKNSaeTer6KzQV.jpg","poster_path":"https://image.tmdb.org/t/p/original/dopuAwrXi4fbnC47MTW2LUBgM9B.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"2157":{"id":"2157","name":"Perdidos no Espaço","slug":"perdidos-no-espaco","original_title":"Lost in Space","overview":"Na segunda metade do século XXI, as fontes de energia de origem fóssil estão para serem esgotadas. Na tentativa de salvar a raça humana os cientistas construíram um portal que permite que a viagem na velocidade da luz possa ser possível, mas só se existir um outro portal para receber os viajantes. Com isso, um cientista e sua família são escolhidos para viajar em velocidade normal até o local onde o segundo portal deve ser construído, numa viagem que durará dez anos e onde os tripulantes ficarão criogenicamente congelados até chegarem em Alpha Prime, o único planeta habitável conhecido. Totalmente perdidos, eles se defrontam com uma infinidade de perigos que os ameaçam constantemente e tentam encontrar Alpha Prime para construírem o segundo portal, que é a única esperança da população da Terra.","first_air_date":"1998-04-03","runtime":130,"episode_run_time":[130],"vote_average":5.4,"created_by":["Saltire Entertainment","New Line Cinema","Irwin Allen Productions","Prelude Pictures"],"production_companies":[{"name":"Saltire Entertainment"},{"name":"New Line Cinema"},{"name":"Irwin Allen Productions"},{"name":"Prelude Pictures"}],"cast":["William Hurt","Matt LeBlanc","Mimi Rogers","Heather Graham","Gary Oldman"],"backdrop_path":"https://image.tmdb.org/t/p/original/rcY15o06DwI8Agt9lh6i5Ruv6QJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/lr3YP07PrcmH1ITSrsdHaUP3pb2.jpg","certification":"12","genres":["Ficção científica","Aventura"],"trailer":"N/A"},
