"24001":{"id":"24001","name":"Colinas de Sangue","slug":"colinas-de-sangue","original_title":"The Hills Run Red","overview":"Há muitos anos, um filme de terror cujo assassino usava uma máscara de bebê foi considerado o longa-metragem mais assustador já feito. Só que, misteriosamente, ele parou de ser exibido, e o diretor desapareceu. Tyler é obcecado em descobrir o desfecho do longa e de seu criador, por isso reúne um grupo para ir atrás da filha do cineasta. Quando a encontra, ela lhes diz que a localização do filme, o que os leva a uma casa na floresta, e um novo filme de terror, estrelado por aqueles que só queriam assisti-lo, começa.","first_air_date":"2009-09-29","runtime":81,"episode_run_time":[81],"vote_average":5.8,"created_by":["Dark Castle Entertainment","Warner Premiere","Fever Dreams","Ludovico Technique"],"production_companies":[{"name":"Dark Castle Entertainment"},{"name":"Warner Premiere"},{"name":"Fever Dreams"},{"name":"Ludovico Technique"}],"cast":["Sophie Monk","Tad Hilgenbrink","William Sadler","Janet Montgomery","Alex Wyndham"],"backdrop_path":"https://image.tmdb.org/t/p/original/p715OynJLMeTR0N92guOvo3iJ3s.jpg","poster_path":"https://image.tmdb.org/t/p/original/23KP5NlINlYTL2hISrZ6C7gYvxV.jpg","certification":"18","genres":["Terror","Thriller"],"trailer":"N/A"},
