"22660":{"id":"22660","name":"O Meu Melhor Companheiro","slug":"o-meu-melhor-companheiro","original_title":"Old Yeller","overview":"O jovem Travis Coates (Tommy Kirk) fica encarregado de cuidar do rancho da família, junto com sua mãe e seu irmão mais novo, quando o pai dele viaja para levar uma boiada, na década de 1860. O pequeno Arliss Coates (Kevin Cocoran) acha um cão amarelo perdido na fazenda e resolve dar abrigo, mesmo com a resistência do irmão mais velho Travis. Logo, o cão passa a ser muito amado por todos, mas o seu tempo junto à família pode não durar muito.","first_air_date":"1957-12-25","runtime":83,"episode_run_time":[83],"vote_average":6.9,"created_by":["Walt Disney Productions"],"production_companies":[{"name":"Walt Disney Productions"}],"cast":["Tommy Kirk","Dorothy McGuire","Fess Parker","Kevin Corcoran","Jeff York"],"backdrop_path":"https://image.tmdb.org/t/p/original/bFj82z1rOIEmsin3jbdGzkeBDpv.jpg","poster_path":"https://image.tmdb.org/t/p/original/cAywXQWKv0QgjrKQPHGY6Qle3Zn.jpg","certification":"L","genres":["Aventura","Drama","Família","Faroeste"],"trailer":"N/A"},
