"2039":{"id":"2039","name":"Feitiço da Lua","slug":"feitico-da-lua","original_title":"Moonstruck","overview":"Loretta Castorini, uma contadora do Brooklyn com seus 30 e tantos anos, cujo marido morreu há vários anos em um acidente de ônibus, decide que é hora de se casar novamente. Então, ela aceita a proposta de um agradável, companheiro de meia idade chamado Johnny Cammareri. Loretta está convencida de seu primeiro casamento foi amaldiçoado porque ela e o marido haviam se casado na Câmara Municipal. Então ela está determinada a fazer as coisas direito desta vez, mesmo quando admite para sua mãe, Rose, que não está realmente apaixonada por Johnny. Ao que Rose responde: \"Bom. Quando você o amar, ele vai deixá-la louca, porque eles sabem que podem\". Rose fala por triste experiência, ela suspeita que seu marido, Cosmo, está traindo. Loretta está convencida de que casar com Johnny é a coisa certa a fazer. Até que ela conhece o irmão mais novo Ronny, que trabalha nos fornos em uma padaria do bairro e é mal-humorado e apaixonado. Então surgem as complicações dignas de uma ópera cômica.","first_air_date":"1987-12-16","runtime":102,"episode_run_time":[102],"vote_average":6.9,"created_by":["Star Partners","Metro-Goldwyn-Mayer","Patrick Palmer & Norman Jewison Productions"],"production_companies":[{"name":"Star Partners"},{"name":"Metro-Goldwyn-Mayer"},{"name":"Patrick Palmer & Norman Jewison Productions"}],"cast":["Cher","Nicolas Cage","Vincent Gardenia","Olympia Dukakis","Danny Aiello"],"backdrop_path":"https://image.tmdb.org/t/p/original/5RQ5SIcrtKeUYeYeJLRTljR8LcN.jpg","poster_path":"https://image.tmdb.org/t/p/original/ablr2IqIxnK6UpNh3ori1Lsr4xM.jpg","certification":"12","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
"530154":{"id":"530154","name":"Quatro Histórias de Desejo","slug":"quatro-historias-de-desejo","original_title":"Lust Stories","overview":"O filme Quatro Histórias de Desejo apresenta quatro contos sobre relacionamento, amor, sexo e ciúme na Índia moderna. As histórias retratam com muita vivacidade o cotidiano das relações amorosas. A condução do roteiro é despretensiosa, leve e divertida. Os diálogos são o ponto forte da trama e, mesmo no segundo conto, onde quase não há diálogo verbal, ele existe no olhar da protagonista e na respiração dela.","first_air_date":"2018-06-15","runtime":120,"episode_run_time":[120],"vote_average":6.2,"created_by":["RSVP Movies","Flying Unicorn Entertainment","Tiger Baby"],"production_companies":[{"name":"RSVP Movies"},{"name":"Flying Unicorn Entertainment"},{"name":"Tiger Baby"}],"cast":["Kiara Advani","Radhika Apte","Akash Thosar","Randeep Jha","Bhumi Pednekar"],"backdrop_path":"https://image.tmdb.org/t/p/original/xhHsbpLpPO5AvKx3E6jLXtYAqXV.jpg","poster_path":"https://image.tmdb.org/t/p/original/ap6YP2pD2fSSu1JXSRi0p3r4CYk.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
