"430040":{"id":"430040","name":"No Olho do Furacão","slug":"no-olho-do-furacao","original_title":"The Hurricane Heist","overview":"Ladrões planejam roubar 600 milhões de dólares do Tesouro Americano. No mesmo dia do assalto, um furacão de categoria máxima está previsto chegar à cidade. A população deixa o local, restando apenas um meteorologista, um agente do Tesouro Americano e um ex- fuzileiro naval. Juntos, eles precisam não apenas sobreviver a maior das tempestades, mas também impedir o roubo do século.","first_air_date":"2018-02-28","runtime":103,"episode_run_time":[103],"vote_average":5.7,"created_by":["Lipsync Productions","Head Gear Films","Windfall Films","Signature Pictures","RSVP Entertainment","Metrol Technology","Entertainment Studios","Foresight Unlimited"],"production_companies":[{"name":"Lipsync Productions"},{"name":"Head Gear Films"},{"name":"Windfall Films"},{"name":"Signature Pictures"},{"name":"RSVP Entertainment"},{"name":"Metrol Technology"},{"name":"Entertainment Studios"},{"name":"Foresight Unlimited"}],"cast":["Toby Kebbell","Maggie Grace","Ryan Kwanten","Ralph Ineson","Melissa Bolona"],"backdrop_path":"https://image.tmdb.org/t/p/original/22Q1GGmw1vt1OiTTt2ue9q4k6MW.jpg","poster_path":"https://image.tmdb.org/t/p/original/wKugroGel7UUnM83Kcrn2afPTYB.jpg","certification":"14","genres":["Ação","Aventura","Crime","Thriller"],"trailer":"N/A"},
"15785":{"id":"15785","name":"Cherry 2000","slug":"cherry-2000","original_title":"Cherry 2000","overview":"No futuro, Sam Treadwell vive feliz com a sua bela e sensual mulher, que é na realidade um robot da série Cherry 2000. Quando a sua Cherry é vítima de uma ardente cena de amor na cozinha e entra em curto-circuito, Sam descobre que aquele modelo já não se produz. Inconsolável, Sam contrata a batedora E. Johnson para o levar até um depósito de robots na Zona 7, um território interditado, devastado e altamente perigoso, onde aparentemente ainda se pode encontrar unidades Cherry 2000. Johnson aceita a missão e leva Sam numa alucinante e perigosa aventura ao longo da qual Sam vai descobrir que as mulheres de carne e osso são incomparavelmente melhores que qualquer modelo Cherry.","first_air_date":"1987-11-10","runtime":99,"episode_run_time":[99],"vote_average":6.0,"created_by":["Orion Pictures","ERP Productions"],"production_companies":[{"name":"Orion Pictures"},{"name":"ERP Productions"}],"cast":["Melanie Griffith","David Andrews","Pamela Gidley","Ben Johnson","Marshall Bell"],"backdrop_path":"https://image.tmdb.org/t/p/original/vjlBasTA8imogIxQLHzsUrCMjJB.jpg","poster_path":"https://image.tmdb.org/t/p/original/t3uds00MHLsibhKLCL0BbCEGxXb.jpg","certification":"N/A","genres":["Ação","Aventura","Ficção científica","Comédia","Romance"],"trailer":"N/A"},
"10345":{"id":"10345","name":"K-9: Um Policial Bom pra Cachorro","slug":"k-9-um-policial-bom-pra-cachorro","original_title":"K-9","overview":"Michael Dooley é um policial extravagante que necessita de alguma ajuda para lutar contra Lyman, um traficante de drogas que tem tentado matá-lo. Um conhecido lhe dá Jerry Lee, um pastor alemão que foi treinado para cheirar drogas. Com sua ajuda Dooley espera colocar seu inimigo atrás das grades, mas Jerry Lee tem uma personalidade bem própria e trabalha apenas quando quer. Por sua vez, o cachorro é ótimo para destruir o carro, a casa e a vida sexual de Dooley. Além disto, Tracy, a namorada de Michael Dooley, é seqüestrada por Lyman, que assim pretende deter Dooley, pois Lyman está prestes a entregar um carregamento de drogas que vale alguns milhões de dólares.","first_air_date":"1989-04-28","runtime":101,"episode_run_time":[101],"vote_average":6.1,"created_by":["Gordon Company","Universal Pictures"],"production_companies":[{"name":"Gordon Company"},{"name":"Universal Pictures"}],"cast":["Jim Belushi","Mel Harris","Kevin Tighe","Ed O'Neill","James Handy"],"backdrop_path":"https://image.tmdb.org/t/p/original/vDBdstmX7z7g0yMQMWtWHJszJ4q.jpg","poster_path":"https://image.tmdb.org/t/p/original/bFbpCFDOhtW0SetS37OxbV5ZjYi.jpg","certification":"N/A","genres":["Ação","Comédia","Crime"],"trailer":"N/A"},
"44129":{"id":"44129","name":"A Grande Virada","slug":"a-grande-virada","original_title":"The Company Men","overview":"Bobby Walker não tem o que reclamar da vida. Tem uma bela família, um bom emprego e um deslumbrante Porsche na garagem. O que ele não esperava era que, devido a uma política de redução de pessoal, fosse demitido. Phil Woodward e Gene McClary, seus colegas de trabalho, passam pela mesma situação. A mudança faz com que o trio tenha que redefinir suas vidas, como maridos e pais de família.","first_air_date":"2010-10-21","runtime":104,"episode_run_time":[104],"vote_average":6.5,"created_by":["Battle Mountain Films","Spring Creek Pictures","The Weinstein Company"],"production_companies":[{"name":"Battle Mountain Films"},{"name":"Spring Creek Pictures"},{"name":"The Weinstein Company"}],"cast":["Ben Affleck","Tommy Lee Jones","Chris Cooper","Kevin Costner","Maria Bello"],"backdrop_path":"https://image.tmdb.org/t/p/original/nGYko5jtVcdk2csEDX66e87aBWJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/y8RneyB6GvdHLx0zv3nU53wh5BB.jpg","certification":"14","genres":["Drama"],"trailer":"N/A"},
