"706972":{"id":"706972","name":"Operação Narco","slug":"operacao-narco","original_title":"Narco Sub","overview":"O cartel de drogas colombiano comanda uma missão para atravessar o México e entregar cocaína nos Estados Unidos enquanto mantém duas jovens reféns. O plano é exposto quando o ex-militar Bruce Stryker ajuda a polícia da fronteira a resgatar as duas garotas. Em resposta, o dono do cartel sequestra a família de Bruce e o obriga a ajudar a organização criminosa em seu próximo carregamento, desta vez em um submarino. Agora, cabe a Bruce se tornar um criminoso para resgatar sua família com vida.","first_air_date":"2021-01-22","runtime":93,"episode_run_time":[93],"vote_average":6.7,"created_by":["Welling Films","Deep Water Productions Motion Picture Group"],"production_companies":[{"name":"Welling Films"},{"name":"Deep Water Productions Motion Picture Group"}],"cast":["Tom Vera","Tom Sizemore","Lee Majors","Robert LaSardo","Jim Jimenez"],"backdrop_path":"https://image.tmdb.org/t/p/original/8cdGniwh3vysVRFeWDJNa3bPQbk.jpg","poster_path":"https://image.tmdb.org/t/p/original/7I9P77PCKCQgAxbNK3weNAin318.jpg","certification":"16","genres":["Ação"],"trailer":"N/A"},
