"376812":{"id":"376812","name":"Sultão","slug":"sultao","original_title":"सुल्तान","overview":"Sultan é a história de Sultan Ali Khan - um campeão de luta local com o mundo a seus pés e seu sonho em representar a Índia na Olimpíada. E a história de Aarfa - uma lutadora habitante da mesma pequena cidade que Sultan com seus próprios sonhos. Quando os dois se encontram, o romance floresce e seus sonhos e aspirações tornam-se interligados e alinhados. No entanto, o caminho para a glória é muito rochoso e se deve cair várias vezes antes de chegar a vitória. Sultan luta para derrotar todas as probabilidades que vão contra ele. Mas quando ele não tem nada a perder e tudo a ganhar nesta luta por sua vida... Só lhe resta acredita que ele tem o que é preciso.","first_air_date":"2016-07-06","runtime":170,"episode_run_time":[170],"vote_average":6.9,"created_by":["Yash Raj Films"],"production_companies":[{"name":"Yash Raj Films"}],"cast":["Salman Khan","Anushka Sharma","Randeep Hooda","Amit Sadh","Kumud Mishra"],"backdrop_path":"https://image.tmdb.org/t/p/original/zevBAAJjUpQTsrRVx2CRTvNXi9r.jpg","poster_path":"https://image.tmdb.org/t/p/original/vPTYtKuV8X5uUd3SqnzO14W6Dti.jpg","certification":"N/A","genres":["Drama","Ação","Romance"],"trailer":"N/A"},
