"4688":{"id":"4688","name":"Através do Universo","slug":"atraves-do-universo","original_title":"Across the Universe","overview":"A música dos Beatles e a Guerra do Vietnã formam o pano de fundo para o romance entre Lucy, uma garota americana da alta classe, e Jude, um pobre artista de Liverpool. É uma história de amor ambientada na década de 1960, em meio aos turbulentos anos de protesto contra a guerra, à luta pela liberdade de expressão e aos direitos civis, à exploração da mente e ao rock and roll enfim, os movimentos da contracultura daquela época. Ao mesmo tempo corajosa, extravagante e altamente teatral, a história vai das escolas secundárias e universidades de Massachusetts, Princeton e Ohio para o Lower East Side de Manhattan, os motins de Detroit, o Vietnã e os estaleiros de Liverpool. Uma combinação de ação ao vivo e animação, o filme está sonorizado com muitas músicas dos Beatles que definiram aquele tempo.","first_air_date":"2007-09-14","runtime":133,"episode_run_time":[133],"vote_average":7.1,"created_by":["Revolution Studios","Team Todd","Gross Entertainment","Sound Films"],"production_companies":[{"name":"Revolution Studios"},{"name":"Team Todd"},{"name":"Gross Entertainment"},{"name":"Sound Films"}],"cast":["Evan Rachel Wood","Jim Sturgess","Joe Anderson","Dana Fuchs","Martin Luther"],"backdrop_path":"https://image.tmdb.org/t/p/original/uov0QRXGEaIsVGis2ttJ1ax32Kc.jpg","poster_path":"https://image.tmdb.org/t/p/original/2XMnFYQqRUnfUnV1nUnzZTuxDSy.jpg","certification":"14","genres":["Drama","Romance","Fantasia"],"trailer":"eVffKLKfenA"},
"27958":{"id":"27958","name":"Parceiros da Noite","slug":"parceiros-da-noite","original_title":"Cruising","overview":"Al Pacino é o policial que se infiltra na comunidade gay de Nova York para tentar desvendar a identidade de um assassino que está aterrorizando o grupo. A experiência se revela muito mais brutal do que ele poderia imaginar. Para encontrar o maníaco, precisa mergulhar na atmosfera dos clubes de sadomasoquismo e outros redutos gays da cidade. A investigação acaba comprometendo o relacionamento com sua namorada, Nancy (Karen Allen), e o coloca frente a frente com seus dilemas pessoais. Drama policial baseado no livro de Gerald Walker.","first_air_date":"1980-02-15","runtime":106,"episode_run_time":[106],"vote_average":6.6,"created_by":["Lorimar Film Entertainment","Jerry Weintraub Productions","CiP - Europaische Treuhand AG"],"production_companies":[{"name":"Lorimar Film Entertainment"},{"name":"Jerry Weintraub Productions"},{"name":"CiP - Europaische Treuhand AG"}],"cast":["Al Pacino","Paul Sorvino","Karen Allen","Richard Cox","Don Scardino"],"backdrop_path":"https://image.tmdb.org/t/p/original/6Dm3hMRAFJqMS9wGkCY14XbZFrm.jpg","poster_path":"https://image.tmdb.org/t/p/original/dB5F4GLRdvWPiGIu7cD4S888FUG.jpg","certification":"N/A","genres":["Crime","Mistério","Thriller"],"trailer":"N/A"},
"11610":{"id":"11610","name":"Sonhos de um Sedutor","slug":"sonhos-de-um-sedutor","original_title":"Play It Again, Sam","overview":"Um neurótico crítico de cinema (Woody Allen), obcecado pelo filme Casablanca (1942), é abandonado por sua esposa e seu ego fica destruído. Seu exemplo de herói é o cara durão interpretado por Humphrey Bogart em muitos de seus filmes. Então Bogart começa a aparecer ao vivo para lhe dar conselhos. Com o encorajamento de um casal de amigos ele realmente tenta namorar novamente, mas com resultados pouco satisfatórios. (e 14 - Estimado 14 Anos)","first_air_date":"1972-05-04","runtime":85,"episode_run_time":[85],"vote_average":7.5,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Woody Allen","Diane Keaton","Tony Roberts","Jerry Lacy","Susan Anspach"],"backdrop_path":"https://image.tmdb.org/t/p/original/6YaphqLSVChdWgF7csZVjM0b08Y.jpg","poster_path":"https://image.tmdb.org/t/p/original/gpSGxqyoeKy34BOlv5GedREd3My.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
