"97614":{"id":"97614","name":"A Fuga","slug":"a-fuga","original_title":"Deadfall","overview":"Em uma região próxima a fronteira com o Canadá, os irmãos Addison (Eric Bana) e Liza (Olivia Wilde) sofrem um acidente durante a fuga de um assalto cometido por eles. Para despistar a polícia, decidem se separar momentaneamente e seguem caminhos distintos. Enquanto isso, o jovem Jay (Charlie Hunnam) acaba de sair da prisão com a intenção de encontrar a mãe (Sissy Spacek) e o pai (Kris Kristofferson) durante o feriado de Ação de Graças. Mas ele acaba conhecendo Liza no meio do caminho e sem saber do passado dela, se deixa seduzir por sua beleza. Só que o tal irmão da garota vinha deixando um rastro de sangue por onde passava e seus destinos podem se cruzar a qualquer momento.","first_air_date":"2012-11-08","runtime":95,"episode_run_time":[95],"vote_average":6.0,"created_by":["Magnolia Pictures","StudioCanal","Madhouse Entertainment","2929 Productions","Mutual Film Company"],"production_companies":[{"name":"Magnolia Pictures"},{"name":"StudioCanal"},{"name":"Madhouse Entertainment"},{"name":"2929 Productions"},{"name":"Mutual Film Company"}],"cast":["Eric Bana","Olivia Wilde","Charlie Hunnam","Kate Mara","Kris Kristofferson"],"backdrop_path":"https://image.tmdb.org/t/p/original/vJTpt1O4ujcanoH1gqXao51b6JU.jpg","poster_path":"https://image.tmdb.org/t/p/original/xDR8WXaxuy84S4Q6tAYyByZve7L.jpg","certification":"14","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
