"10307":{"id":"10307","name":"Stigmata","slug":"stigmata","original_title":"Stigmata","overview":"Belo Quinto recebe a visita do padre Andrew Kiernan (Gabriel Byrne), que foi mandado pelo Vaticano para investigar uma igreja que tem a estátua de uma santa que verte lágrimas de sangue. Lágrimas estas que começaram no dia em que o padre Paulo Almeida morreu. Enquanto Kiernan fotografava a estátua um garoto furta um rosário que estava junto do corpo do falecido e vende o terço para uma turista, que por sua vez manda de presente para Frankie Paige (Patricia Arquette), sua filha. Em pouco tempo, ela passa a ser vítima de \"estigmas\" e Andrew Kiernan o encarregado de investigar o fenômeno. Inicialmente Kiernan descarta a possibilidade dos \"estigmas\", mas Kiernan vê o suficiente para quebrar os padrões estabelecidos pelo Vaticano, e acredita que se ele não fizer nada, Frankie pode morrer. Gradativamente, ele passa a suspeitar que seu superior, o cardeal Daniel Houseman (Jonathan Pryce), não quer que toda a verdade venha tona.","first_air_date":"1999-09-02","runtime":103,"episode_run_time":[103],"vote_average":6.3,"created_by":["FGM Entertainment","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"FGM Entertainment"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Patricia Arquette","Gabriel Byrne","Jonathan Pryce","Nia Long","Thomas Kopache"],"backdrop_path":"https://image.tmdb.org/t/p/original/t1wXPJuhUXCcv5X2Wl615nmIvtk.jpg","poster_path":"https://image.tmdb.org/t/p/original/p3Ead51dWRTXT9c0OHTes7tHZBP.jpg","certification":"14","genres":["Terror","Thriller","Fantasia"],"trailer":"N/A"},
