"4226":{"id":"4226","name":"Histeria","slug":"histeria","original_title":"Shriek If You Know What I Did Last Friday the Thirteenth","overview":"Em todo filme de terror, tem um telefone prestes a tocar... uma vítima esperando para gritar... um assassino pronto para atacar. E o único modo de sobreviver a isso, é ficar sempre um passo na frente do assassino... mesmo que o assassino seja um tremendo trapalhão! Agora, nossa sexy repórter, se uniu a um policial meio abobalhado para perseguir um assassino que está tentando matar os alunos mais populares da escola. O resultado é uma sátira bem humorada aos filmes de terror de maior sucesso da atualidade.","first_air_date":"2000-10-17","runtime":86,"episode_run_time":[86],"vote_average":4.7,"created_by":["Endless Entertainment","Rhino Films","Sea Dragon"],"production_companies":[{"name":"Endless Entertainment"},{"name":"Rhino Films"},{"name":"Sea Dragon"}],"cast":["Tiffani Thiessen","Tom Arnold","Coolio","Majandra Delfino","Julie Benz"],"backdrop_path":"https://image.tmdb.org/t/p/original/nVSnGZQdu9GTFIlDU0yvPl3Evlp.jpg","poster_path":"https://image.tmdb.org/t/p/original/dk14AeL7CMgDb8mUYjR48OBE2bL.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"112336":{"id":"112336","name":"Hitchcock","slug":"hitchcock","original_title":"Hitchcock","overview":"Baseado no livro \"Alfred Hitchcock And The Making Of Psycho\", este filme revela os bastidores do clássico Psicose (1960). Na época, mesmo estando no auge de sua carreira, Hitchcock não conseguiu apoio para realizar a obra, porque os estúdios não queriam investir em um pequeno filme de terror. O resultado foi uma produção independente, que encontrou dificuldades para driblar a censura e para ser distribuída nos EUA, em função das cenas de violência e nudez. Além disso, durante as filmagens, ocorreram brigas entre Hitchcock e sua esposa, Alma, os problemas de saúde do diretor e desentendimentos com o elenco. Mas contrariando todas as expectativas, \"Psicose\" se tornou uma referência no cinema mundial e um dos maiores sucessos na carreira do cineasta.","first_air_date":"2012-11-22","runtime":98,"episode_run_time":[98],"vote_average":6.6,"created_by":["Cold Spring Pictures","The Montecito Picture Company"],"production_companies":[{"name":"Cold Spring Pictures"},{"name":"The Montecito Picture Company"}],"cast":["Anthony Hopkins","Helen Mirren","Scarlett Johansson","Danny Huston","Toni Collette"],"backdrop_path":"https://image.tmdb.org/t/p/original/ktY9QTrPToBZ1RlpSOcD7CaExdy.jpg","poster_path":"https://image.tmdb.org/t/p/original/zlG4QzB00VM6QHUmRkKaboCOgat.jpg","certification":"12","genres":["Drama"],"trailer":"N/A"},
