"8954":{"id":"8954","name":"Traídos pelo Destino","slug":"traidos-pelo-destino","original_title":"Reservation Road","overview":"Ethan e Grace Learner estão voltando para casa com seus filhos, Josh e Emma. Na viagem, Josh pergunta à mãe se pode ficar com uns vaga-lumes que tinha capturado para um frasco. A mãe responde que seria melhor soltá-los, pois caso contrário morreriam. Enquanto Josh salta do carro para soltar os vaga-lumes, Dwight Arno, um advogado divorciado, atropela-o sem parar para socorrê-lo. Ethan vê o carro e seu condutor em um relance, mas corre para socorrer o filho. O garoto morre, e Ethan promete a si mesmo descobrir e punir o culpado. .","first_air_date":"2007-09-13","runtime":102,"episode_run_time":[102],"vote_average":6.5,"created_by":["Nick Wechsler/Miracle Pictures","Volume One Entertainment","Miracle Pictures"],"production_companies":[{"name":"Nick Wechsler/Miracle Pictures"},{"name":"Volume One Entertainment"},{"name":"Miracle Pictures"}],"cast":["Joaquin Phoenix","Jennifer Connelly","Elle Fanning","Sean Curley","Mark Ruffalo"],"backdrop_path":"https://image.tmdb.org/t/p/original/4h24iK9gizpa3RoaLPBaciVrF19.jpg","poster_path":"https://image.tmdb.org/t/p/original/uWl5Wigcc0bdXBZoxjwGyeRIiNo.jpg","certification":"12","genres":["Drama","Crime","Thriller"],"trailer":"N/A"},
"10015":{"id":"10015","name":"O Destemido Senhor da Guerra","slug":"o-destemido-senhor-da-guerra","original_title":"Heartbreak Ridge","overview":"O sargento da Marinha Thomas Highway é um veterano condecorado de duas guerras, que foi designado para treinar um grupo de recrutas indisciplinados. Em seu último posto, ele era cercado por oficiais sem experiência alguma de combate que o consideravam um homem estranho e até mesmo perigoso. Conforme o sargento prepara seus homens para guerra, que eles acreditam que não acontecerá, os Estados Unidos invade Granada.","first_air_date":"1986-12-05","runtime":130,"episode_run_time":[130],"vote_average":6.9,"created_by":["Jay Weston Productions","Malpaso Productions"],"production_companies":[{"name":"Jay Weston Productions"},{"name":"Malpaso Productions"}],"cast":["Clint Eastwood","Marsha Mason","Everett McGill","Moses Gunn","Mario Van Peebles"],"backdrop_path":"https://image.tmdb.org/t/p/original/ydF3hT1fjrM71AbNAYBZKnq6rtL.jpg","poster_path":"https://image.tmdb.org/t/p/original/ztSXQQXnBkMPo6hBqZFuIcs0UbB.jpg","certification":"N/A","genres":["Guerra","Drama"],"trailer":"N/A"},
"598826":{"id":"598826","name":"Sardar Udham","slug":"sardar-udham","original_title":"सरदार उधम","overview":"A história acompanha as 2 décadas que o revolucionário Udham Singh que, marcado pelo massacre de Jallianwala Bagh, passou a planear o assassinato do homem responsável pelo massacre. Ele escapou para as montanhas do Afeganistão, chegando a Londres em 1933. Carregou uma ferida não curada por 21 anos e assassinou Michael O'Dwyer em 13 março de1940, o homem no comando dos assuntos em Punjab, em 1919, para se vingar pelas vidas perdidas de seus irmãos.","first_air_date":"2021-10-16","runtime":162,"episode_run_time":[162],"vote_average":7.1,"created_by":["Kino Works","Rising Sun Films","MD Trade","Alchemie Overseas"],"production_companies":[{"name":"Kino Works"},{"name":"Rising Sun Films"},{"name":"MD Trade"},{"name":"Alchemie Overseas"}],"cast":["Vicky Kaushal","Shaun Scott","Stephen Hogan","Amol Parashar","Kirsty Averton"],"backdrop_path":"https://image.tmdb.org/t/p/original/oZftUn6yOt61LItXE4zPOz4rca9.jpg","poster_path":"https://image.tmdb.org/t/p/original/3ttKkiBGWU9gAqf2FViLF1wiwpK.jpg","certification":"16","genres":["Crime","Drama","História"],"trailer":"N/A"},
"20829":{"id":"20829","name":"Tá Rindo do Quê?","slug":"ta-rindo-do-que","original_title":"Funny People","overview":"George Simmons é um popular comediante, que descobre que possui uma doença sanguínea incurável. Devido a ela, George tem apenas mais um ano de vida. Ira Wright é um comediante em ascensão, que tem dificuldades em dissociar seus personagens dele próprio. George e Ira têm uma característica em comum: não possuem amigos próximos. Uma noite eles se conhecem quando farão apresentações no mesmo local. George contrata Ira para ser seu assistente pessoal, abrindo seus shows. Logo eles se tornam amigos, com George ensinando a Ira como conduzir o público do palco e Ira ajudando-o a encontrar seu legado.","first_air_date":"2009-07-30","runtime":146,"episode_run_time":[146],"vote_average":5.9,"created_by":["Universal Pictures","Columbia Pictures","Relativity Media","Apatow Productions","Madison 23","Happy Madison Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Columbia Pictures"},{"name":"Relativity Media"},{"name":"Apatow Productions"},{"name":"Madison 23"},{"name":"Happy Madison Productions"}],"cast":["Adam Sandler","Seth Rogen","Leslie Mann","Eric Bana","Jonah Hill"],"backdrop_path":"https://image.tmdb.org/t/p/original/stNs9ZEcTT9tkZwGNt1HBxAsfXl.jpg","poster_path":"https://image.tmdb.org/t/p/original/iHip49xg1rZV7amlL9XTgd0KCsS.jpg","certification":"16","genres":["Comédia","Drama"],"trailer":"N/A"},
