"14326":{"id":"14326","name":"Noites de Tormenta","slug":"noites-de-tormenta","original_title":"Nights in Rodanthe","overview":"A vida de Adrienne Willis (Diane Lane) está um caos, o que faz com que busque refúgio em Rodanthe, uma pequena cidade litorânea na Carolina do Norte. Lá ela fica na pousada de uma amiga, onde espera refletir sobre seus problemas com a filha adolescente, que vive criticando-a, e com seu antigo marido, que pediu para retornar para casa. Logo chega ao local o dr. Paul Flanner (Richard Gere), que enfrenta uma crise de consciência. Com uma violenta tempestade se aproximando, eles se conhecem melhor e, buscando consolo um no outro, têm um fim de semana que muda para sempre suas vidas.","first_air_date":"2008-09-26","runtime":97,"episode_run_time":[97],"vote_average":6.3,"created_by":["Village Roadshow Pictures","Di Novi Pictures","Warner Bros. Pictures"],"production_companies":[{"name":"Village Roadshow Pictures"},{"name":"Di Novi Pictures"},{"name":"Warner Bros. Pictures"}],"cast":["Diane Lane","Richard Gere","Christopher Meloni","Viola Davis","Becky Ann Baker"],"backdrop_path":"https://image.tmdb.org/t/p/original/wFfGk3kwGJGz43Ffup9SZ7pICW9.jpg","poster_path":"https://image.tmdb.org/t/p/original/3tFqK5wieaATdt54Y7A28O5lkj2.jpg","certification":"10","genres":["Drama","Romance"],"trailer":"N/A"},
"11940":{"id":"11940","name":"Simbad e o Olho do Tigre","slug":"simbad-e-o-olho-do-tigre","original_title":"Sinbad and the Eye of the Tiger","overview":"Simbad, corajoso marinheiro e Príncipe de Bagdá, sai em direção a Charnak com intenção de pedir ao Príncipe Kassim para se casar com sua irmã, Farah. Mas Simbad descobre que Kassim está possuído por um feitiço de sua maligna madrasta, Zenobia. Para quebrar a magia, Simbad tem que sair em uma jornada nunca antes realizada. Esperando por eles nesta perigosa viagem estão uma variedade de bestas que vão além da mais delirante imaginação. Entre as criaturas estão o Minoton, um colosso de bronze, um gigante troglodita, um tigre com dentes de sabre e um babuíno \"quase humano\".","first_air_date":"1977-07-15","runtime":112,"episode_run_time":[112],"vote_average":6.6,"created_by":["Andor Films","Columbia Pictures"],"production_companies":[{"name":"Andor Films"},{"name":"Columbia Pictures"}],"cast":["Patrick Wayne","Taryn Power","Jane Seymour","Patrick Troughton","Kurt Christian"],"backdrop_path":"https://image.tmdb.org/t/p/original/dAS0FInfgpqzpG8KXzJ3pX4lc7A.jpg","poster_path":"https://image.tmdb.org/t/p/original/7dBZbxyWW7zhFSgEoEvXElBGV0q.jpg","certification":"N/A","genres":["Ação","Aventura","Família","Fantasia","Ficção científica"],"trailer":"N/A"},
