"12766":{"id":"12766","name":"Vera Cruz","slug":"vera-cruz","original_title":"Vera Cruz","overview":"Cooper e Lancaster interpretam Benjamin Trane e Joe Erin, dois perigosos mercenários que viajam ao México em busca de aventura - e dinheiro - durante a Guerra Civil de 1866. Mas eles conseguem mais do que haviam negociado quando foram contratados pela bela e rica Condessa Duvarre (Denise Darcel) para escoltá-la e a uma fortuna em ouro até as forças militares do Imperador Maximiliano em Vera Cruz. O caminho é cheio de perigos, traição e assassinato... e quando Bem é apanhado pelo fervor dos revolucionários, ele e Joe vêem-se em confronto com o Exército Mexicano - e um com o outro!","first_air_date":"1954-12-25","runtime":94,"episode_run_time":[94],"vote_average":6.6,"created_by":["Hecht-Lancaster Productions"],"production_companies":[{"name":"Hecht-Lancaster Productions"}],"cast":["Gary Cooper","Burt Lancaster","Denise Darcel","Cesar Romero","Sara Montiel"],"backdrop_path":"https://image.tmdb.org/t/p/original/c6p0ZqqczrqmL6cUFEu0bKMR3Ff.jpg","poster_path":"https://image.tmdb.org/t/p/original/7sDTIHW0nG8CqzskwBJtmUnBwcK.jpg","certification":"14","genres":["Faroeste"],"trailer":"N/A"},
