"76122":{"id":"76122","name":"Marvel One Shot: O Consultor","slug":"marvel-one-shot-o-consultor","original_title":"Marvel One-Shot: The Consultant","overview":"Após tudo o que envolveu O Incrível Hulk, o agente da S.H.I.E.L.D. Phil Coulson tem más notícias para dar ao agente Jasper Sitwell: O Conselho de Segurança Mundial quer que Emil Blonsky se una à Iniciativa Vingadores, e Coulson tem ordens para obter sua libertação do general Thaddeus Ross. Incapazes de desafiar o pedido do Conselho, Coulson e Sitwell elaboram um plano para sabotá-lo... com uma arma secreta muito especial.","first_air_date":"2011-09-13","runtime":4,"episode_run_time":[4],"vote_average":6.3,"created_by":["Marvel Studios","Ebeling Group"],"production_companies":[{"name":"Marvel Studios"},{"name":"Ebeling Group"}],"cast":["Maximiliano Hernández","Clark Gregg","Robert Downey Jr.","William Hurt","Deborah Knox"],"backdrop_path":"https://image.tmdb.org/t/p/original/r1Q3jyOpfbF3VDU52w8RzkTPbfe.jpg","poster_path":"https://image.tmdb.org/t/p/original/cfEXCNAAdCc8czAqdo4Me3iwuxM.jpg","certification":"N/A","genres":["Aventura","Fantasia","Ficção científica","Ação"],"trailer":"N/A"},
