"24748":{"id":"24748","name":"O Indomado","slug":"o-indomado","original_title":"Hud","overview":"Hud Bannon é um jovem implacável que mancha tudo e todos os que ele toca. Hud representa a encarnação perfeita da juventude alienada, pronto para brigar sem levar em conta as consequências. Há um amargo conflito entre o insensível Hud e seu severo e cheio de princípios pai, Homer. Lon, seu sobrinho, admira os truques e trapaças de Hud, embora logo se perceba que a amoralidade imprudente de Hud não o sustentaria. No mundo dos ganhadores e perdedores Hud é um vencedor. Ele é um trapaceiro, mas, ele explica: \"Eu sempre digo que a lei deveria ser interpretada de maneira indulgente\". (e 14 - Estimado 14 Anos)","first_air_date":"1963-05-28","runtime":112,"episode_run_time":[112],"vote_average":7.3,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Paul Newman","Melvyn Douglas","Patricia Neal","Brandon De Wilde","Whit Bissell"],"backdrop_path":"https://image.tmdb.org/t/p/original/dlmROevxOVYtZXRUzt6DGJzl9BL.jpg","poster_path":"https://image.tmdb.org/t/p/original/A168bF52vmAIGkC2Qafj7M2EmaE.jpg","certification":"N/A","genres":["Drama","Faroeste"],"trailer":"N/A"},
