"837881":{"id":"837881","name":"Ela Disse","slug":"ela-disse","original_title":"She Said","overview":"Inspirado na investigação do New York Times, este filme segue a incrível história verídica de como as repórteres Megan Twohey e Jodi Kantor passaram de desconhecidas a inspirações, quebrando o silêncio em torno do assunto de agressão sexual em Hollywood. Determinadas em expor a verdade que muitos tinham medo de contar, a parceria entre Megan e Jodi agita o sistema, dando poder às mulheres corajosas para recuperar sua força através de histórias de sobrevivência, neste filme extraordinário.","first_air_date":"2022-11-17","runtime":129,"episode_run_time":[129],"vote_average":7.2,"created_by":["Plan B Entertainment","Annapurna Pictures","Universal Pictures"],"production_companies":[{"name":"Plan B Entertainment"},{"name":"Annapurna Pictures"},{"name":"Universal Pictures"}],"cast":["Zoe Kazan","Carey Mulligan","Patricia Clarkson","Andre Braugher","Jennifer Ehle"],"backdrop_path":"https://image.tmdb.org/t/p/original/5tb7RjF0OAAaiGDUXsuedvhoGqV.jpg","poster_path":"https://image.tmdb.org/t/p/original/8BNJjZRfNoD0bskwuY3Oekzz2Ih.jpg","certification":"12","genres":["Drama","História"],"trailer":"2e9Fs_5jsWI"},
