"15856":{"id":"15856","name":"A Casa dos Maus Espíritos","slug":"a-casa-dos-maus-espiritos","original_title":"House on Haunted Hill","overview":"Frederick Loren (Vincent Price) é o dono de uma sinistra mansão em uma sinistra colina, que oferece dez mil dólares para cada um dos seus inimigos se eles concordarem em passar uma noite na casa. Frederick dá para cada um dos seus convidados um pequeno caixão, contendo uma arma. Ele então começa a acionar diversos dispositivos, para amedrontar seus convidados e fazê-los usar suas armas. Porém, por mais estranho que possa parecer, ele não é o mais maquiavélico das pessoas da casa. Esta honra vai para Annabelle Loren (Carol Ohmart), sua mulher, e o Dr. David Trent (Alan Marshal), seu amante.","first_air_date":"1959-01-01","runtime":75,"episode_run_time":[75],"vote_average":6.8,"created_by":["William Castle Productions","Allied Artists Pictures"],"production_companies":[{"name":"William Castle Productions"},{"name":"Allied Artists Pictures"}],"cast":["Vincent Price","Carol Ohmart","Richard Long","Alan Marshal","Carolyn Craig"],"backdrop_path":"https://image.tmdb.org/t/p/original/vzw5733T4PSielVOeq268GdSzhS.jpg","poster_path":"https://image.tmdb.org/t/p/original/gyL2xiAdcrK4iZ4pQn0HJjNDEJF.jpg","certification":"N/A","genres":["Terror","Mistério"],"trailer":"N/A"},
